import FeedIcon from "@mui/icons-material/Feed";
import MoreHorizIcon from "@mui/icons-material/MoreHoriz";
import {
  Card,
  IconButton,
  Typography,
  styled,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import * as React from "react";
import { useState } from "react";
import {
  CartesianGrid,
  Legend,
  Line,
  LineChart,
  ResponsiveContainer,
  Tooltip,
  XAxis,
  YAxis,
} from "recharts";
import DashTab from "../NavBar/DashTab";

// const Item = styled(Paper)(({ theme }) => ({
//   // backgroundColor: theme.palette.mode === "dark" ? "#80808052" : "#fff",
//   ...theme.typography.body2,
//   padding: theme.spacing(1),
//   textAlign: "center",
//   color: theme.palette.text.secondary,
// }));

export default function BasicGrid() {

  const [selectedOption, setSelectedOption] = useState("");

  const handleChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const data = [
    {
      name: "Week 1",
      Shirt: 0,
      Pants: 12,
      Jacket: 18,
      amt: 10,
    },
    {
      name: "Week 2",
      Shirt: 12,
      Pants: 5,
      Jacket: 30,
      amt: 20,
    },
    {
      name: "Week 3",
      Shirt: 38,
      Pants: 20,
      Jacket: 25,
      amt: 30,
    },
    {
      name: "Week 4",
      Shirt: 28,
      Pants: 13,
      Jacket: 40,
      amt: 40,
    },
  ];

  const StyledCard = styled(Grid)(({ theme }) => ({
    padding: "10px 15px",
    margin: "20px",
    border: "1px solid white",
    cursor: "pointer",
    borderRadius: "10px",
    "&:hover": {
      color: "#80808052",
      background: "linear-gradient(to right, rgb(164 63 177), rgb(56 103 175))",
    },
  }));

  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down("sm"));

  return (
    <>
      <Grid>
        <Box sx={{ flexGrow: 1, marginTop: "3%" }}>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6} sx={{ height: "100%" }}>
              <Card
                sx={{
                  width: "100%",
                  display: "flex",
                  flexDirection: "column",
                  background: "#80808052",
                }}
              >
                <Grid
                  container
                  sx={{
                    display: "flex",
                    flexDirection: "row",

                    justifyContent: "center",
                  }}
                >
                  <Grid item textAlign={"left"} xs={12} md={10}>
                    <strong
                      style={{
                        // fontWeight: "bold",
                        padding: "30px",
                        fontSize: "30px",

                        color: "white",
                      }}
                    >
                      Sales
                    </strong>
                  </Grid>

                  <Grid item textAlign={"center"} xs={12} md={2}>
                    <IconButton
                      size="large"
                      aria-label="display more actions"
                      edge="end"
                      sx={{ color: "white" }}
                    >
                      <MoreHorizIcon />
                    </IconButton>
                  </Grid>
                </Grid>

                {/******Cards **********/}
                <Grid
                  container
                  sx={{
                    display: "flex",
                    flexDirection: "row",
                    alignItems: "center",
                    justifyContent: "center",
                  }}
                >
                  <StyledCard item xs={12} sm={4} md={2}>
                    <Typography
                      sx={{
                        color: "white",
                        fontSize: "30px",
                        marginTop: "5px",
                      }}
                    >
                      500
                    </Typography>
                    <Typography sx={{ color: "white" }}>Orders</Typography>
                  </StyledCard>
                  <StyledCard item xs={12} sm={4} md={2}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      200
                    </Typography>
                    <Typography sx={{ color: "white" }}>Delivered</Typography>
                  </StyledCard>
                  <StyledCard item xs={12} sm={4} md={2}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      100
                    </Typography>
                    <Typography sx={{ color: "white" }}>Pending</Typography>
                  </StyledCard>
                  <StyledCard item xs={12} sm={4} md={2}>
                    <Typography sx={{ color: "white", fontSize: "30px" }}>
                      500
                    </Typography>
                    <Typography sx={{ color: "white" }}>Packed</Typography>
                  </StyledCard>
                </Grid>
              </Card>

              <DashTab />
            </Grid>

            {/* Graph */}

            <Grid item xs={12} md={6}>
              <Item
                sx={{
                  background: "#80808052",
                }}
              >
                <Grid
                  container
